import React from 'react';
import { Route } from 'react-router-dom';
import CompletedGoalsPage from './Components/CompletedGoalsPage';

const Routes = () => {
  return (
    <>
      <Route path="/completed" component={CompletedGoalsPage} />
    </>
  );
};

export default Routes;
